customMap:
function customMap(func){
	let newArray = [];
	for (let i = 0; i < this.length; i++) {
		const newItem = func(this[i]);
		newArray.push(newItem);
	}
	return newArray;
}

customForeach:
function customForeach(func){
	for (let i = 0; i < this.length; i++) {
		this[i] = func(this[i]);
	}
	return this;
}

customFilter:
function customFilter(func){
	let newArray = [];
	for (let i = 0; i < this.length; i++) {
		const currentItem = this[i];
		if(func(currentItem)){
			newArray.push(currentItem);
		}
	}
	return newArray;
}
